ELSE 48 END ELSE CASE WHEN (model_input."X_3" <= 6.000000) THEN 71 ELSE 72 END END END ELSE CASE WHEN (model_input."X_0" <= 8.000000) THEN CASE WHEN (model_input."X_1" <= 2.500000) THEN CASE WHEN (model_input."X_2" <= 6.000000) THEN 101 ELSE 102 END ELSE CASE WHEN (model_input."X_1" <= 3.500000) THEN CASE WHEN (model_input."X_2" <= 6.000000) THEN 99 ELSE 100 END ELSE CASE WHEN (model_input."X_0" <= 6.500000) THEN 91 ELSE 92 END END END ELSE CASE WHEN (model_input."X_3" <= 4.500000) THEN 61 ELSE CASE WHEN (model_input."X_3" <= 5.500000) THEN 95 ELSE 96 END END END END END END ELSE CASE WHEN (model_input."X_0" <= 5.500000) THEN CASE WHEN (model_input."X_0" <= 2.500000) THEN CASE WHEN (model_input."X_2" <= 2.500000) THEN CASE WHEN (model_input."X_1" <= 8.000000) THEN 97 ELSE 98 END ELSE CASE WHEN (model_input."X_0" <= 0.500000) THEN 107 ELSE CASE WHEN (model_input."X_1" <= 7.000000) THEN 119 ELSE 120 END END END ELSE CASE WHEN (model_input."X_2" <= 4.500000) THEN 77 ELSE CASE WHEN (model_input."X_1" <= 7.500000) THEN CASE WHEN (model_input."X_0" <= 4.500000) THEN 113 ELSE 114 END ELSE 106 END END END ELSE CASE WHEN (model_input."X_2" <= 1.500000) THEN 53 ELSE CASE WHEN (model_input."X_2" <= 4.500000) THEN CASE WHEN (model_input."X_3" <= 0.500000) THEN 69 ELSE CASE WHEN (model_input."X_1" <= 8.500000) THEN 115 ELSE CASE WHEN (model_input."X_0" <= 7.500000) THEN 117 ELSE 118 END END END ELSE CASE WHEN (model_input."X_1" <= 7.000000) THEN CASE WHEN (model_input."X_2" <= 8.500000) THEN CASE WHEN (model_input."X_1" <= 5.500000) THEN 121 ELSE 122 END ELSE 90 END ELSE CASE WHEN (model_input."X_2" <= 7.000000) THEN CASE WHEN (model_input."X_2" <= 5.500000) THEN 123 ELSE 124 END ELSE 110 END END END END END END ELSE 12 END END AS node_id
